import { Button, Dialog, DialogContent, DialogTitle, TextField, Typography, CardMedia, DialogActions, FormLabel, FormControl } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";

export default function CryptoBlock(props) {

  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handelChange = (e) => {
    props.value(e.target.value, props.name);
  };

  return (
    <>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: "10px", backgroundColor: "green", padding: "20px", borderRadius: "15px" }}>
        <Box sx={{display: "flex"}}>
        <CardMedia
          component="img"
          height="50"
          width="50"
          image="#"
          alt={props.name}
        />
        <Typography> {props.name}</Typography>
        </Box>
        <Button variant="contained" onClick={handleClickOpen} >Buy</Button>
        <Dialog open={open} onClose={handleClose}>
          <DialogTitle>{props.name}</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Amount"
              type="number"
              fullWidth
              variant="standard"
              onChange={handelChange}
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleClose}>Cancel</Button>
            <Button onClick={props.handleClose}>Buy</Button>
          </DialogActions>
        </Dialog>
      </Box>
    </>
  )
};
